import { useState } from "react"
export default (props) => {
    const [text, setText] = useState("")
    let message = ""
    return (
        <>
        <input
            type = "text"
            onChange={e => {
                let message = (e.target.value)
                setText(message)
            }} />
        <h1>{message}</h1>
        </>
    )
}
